import React from "react";
import SidebarItem from "./SidebarItem";
import "./sidebar.css";

function Sidebar() {
  return (
    <React.Fragment>
      <SidebarItem title="Recent Posts">
        <p>This is a test</p>
      </SidebarItem>
      <SidebarItem title="Contact">
        <p>This is a test</p>
      </SidebarItem>
    </React.Fragment>
  );
}

export default Sidebar;
